Le rapport d'activité à déposer doit comprendre l'ensemble des rubriques exigées ci-dessous ou une mention "NEANT" au sein de ces rubriques :

a) Un compte rendu de l'activité du fonds de dotation, qui porte sur son fonctionnement interne et sur ses rapports avec les tiers ;
b) La liste des actions d'intérêt général financées par le fonds de dotation, et leurs montants ;
c) La dénomination, l'adresse du siège social, l'adresse électronique, les coordonnées téléphoniques et la nature des personnes morales bénéficiaires des redistributions, et les montants des redistributions versées ;
d) Si le fonds bénéficie directement ou indirectement d'avantages ou de ressources provenant de l'étranger, leur nature et leurs montants ;
e) Si le fonds de dotation fait appel à la générosité du public, le compte d'emploi des ressources collectées auprès du public prévu à l'article 4 de la loi du 7 août 1991 susvisée, qui précise notamment l'affectation des dons par type de dépenses et qui mentionne les informations relatives à son élaboration ;
f) La liste des libéralités reçues, leurs montants et les personnes émettrices de ces libéralités.

Un modèle de rapport d'activité est disponible ci-dessous.

